import React from "react";

import Button from "./components/Button";


function App() {

  return (
    <div className="App">
      <header className="App-header">

        <h1 className="text-4xl">Tailwind Test</h1>

        <Button />

        <div className='max-w-sm rounded overflow-hidden shadow-lg'>
          <p>CARD</p>
        </div>


      </header>
    </div>
  );
}

export default App;
